import React from "react";
import styled from "styled-components";
import PinterestIcon from "@mui/icons-material/Pinterest";
import Icon from "@mui/material/Icon";

function Header() {
  return (
    <div>
      <Wrapper>
        <LogoWrapper>
          <Icon>
            <PinterestIcon />
          </Icon>
        </LogoWrapper>

        <HomeButton>
          <a href="/">HomePage</a>
        </HomeButton>

        <Following>
          <a href="/">Following</a>
        </Following>

        <SearchWrapper>
          <SearchBar>
            <SearchIconButton>
              <SearchIcon>
                <form>
<input type="text"/>                </form>
              </SearchIcon>
            </SearchIconButton>
          </SearchBar>
        </SearchWrapper>
        {/*

<IconWrapper>

</IconWrapper>
*/}
      </Wrapper>
    </div>
  );
}

export default Header
/*Make sure to name the component then include it in the return()! */
/*Include CSS for components */

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  height: 56px;
  padding: 12px 4px 4px 16px;
  background-color: #ffff;
  color: black;
`
/*Pinterest Logo is considered a svg icon why it's class name is the title */

const LogoWrapper = styled.div`
  .MuiSvgIcon-root {
    color: #e60023;
    font-size: 32px;
    cursor: pointer;
  }
`

/*Styling HomeButton No Hover */

const Home =styled.div
`
display:flex;
height:48px;
min-width:123px;
align-items:center;
justify-content:center;
border-radius:24px;
cursor:pointer;
`
const HomeButton=styled(Home)`
background-color:rgb(17,17,17);



a{
  text-decoration:none;
  color:white;
  font-weight:700;

}

`
/* Styling the button for following */
const Following = styled.div`
  display: flex;
  height: 48px;
  min-width: 123px;
  align-items: center;
  justify-content: center;
  border-radius: 24px;
  cursor: pointer;
  background-color:white;

  a {
    text-decoration: none;
    color: black;
    font-weight: 700;
  }

  :hover{
    background-color:#e1e1e1;
  }
`
